import React, { Component } from "react";
import SearchBar from "./Component/SearchBar";

class App extends Component {
  handleSubmit=()=>{
    console.log("i am submitted");
  };
  render() {
    return (
      <div className="container fontify">

        <SearchBar onSubmit={this.handleSubmit} />
      </div>
    );
  }
}

export default App;
